import React from 'react';
import Navbar from './././N';
import './Homepage.css'; // Import the CSS file

const HomePage = () => {
  return (
    <div>
      <Navbar />
      <div className="homepage-content"> {/* Apply the class here */}
        <h1>Welcome to My Website</h1>
        <img src="your_image_url_here" alt="Website" />
        <p>This is a brief description of what our website is about.</p>
      </div>
    </div>
  );
};

export default HomePage;
